import React from "react";
import {Grid} from "@material-ui/core";
import VidelItem from "./VideoItem";
import VideoItem from "./VideoItem";

const VideoList = (props) => {
    const {videos, onSelectVideo } = props;
    //Map method used  to retun a viedo Item for eact video comming from the searched video list
    const listOfVideos = videos.map((video, id) => <VideoItem onVideoSelect={onSelectVideo} key={id} video={video}/>); //In the video Attr we send the video Obj as prop To use it in VideoItem
    return (
        <Grid container spacing={10}>
            {listOfVideos}
        </Grid>
        
    )
}

export default VideoList;
